import React from "react";
import axios from "axios";
import Link from "next/link";

class Mymainitems extends React.Component {
  static async getInitialProps() {
    var promise = axios
      .get("http://localhost:4000/mymainitems")
      .then(response => {
        return {
          hasErrored: false,
          mymainitemsData: response.data
        };
      })
      .catch(error => {
        return {
          hasErrored: true,
          message: error.message
        };
      });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      mymainitemsData: props.mymainitemsData
    };
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
      <div className="container dwi-div dwi-card">
        <div className="row">
          <div className="card-deck">
            <div className="card col-4 cardmin margintopbottom">

<div className="form-check">
  <input className="form-check-input" type="radio" name="exampleRadios" id="exampleRadios1" value="option1"  />
  <label className="form-check-label" htmlFor="exampleRadios1">
    Default radio
  </label>
</div>
<div className="form-check">
  <input className="form-check-input" type="radio" name="exampleRadios" id="exampleRadios2" value="option2" />
  <label className="form-check-label" htmlFor="exampleRadios2">
    Second default radio
  </label>
</div>
<div className="form-check">
  <input className="form-check-input" type="radio" name="exampleRadios" id="exampleRadios3" value="option3" disabled />
  <label className="form-check-label" htmlFor="exampleRadios3">
    Disabled radio
  </label>
</div>




              <ul>
                {this.state.mymainitemsData.map((mymainitems) => 

<div className="form-check"  key={mymainitems.id}>
<input className="form-check-input" type="radio" name="exampleRadios" id="exampleRadios1" value="option1"  />
<label className="form-check-label" htmlFor="exampleRadios1">
{mymainitems.name}  {mymainitems.salePrice} JUST {mymainitems.numberOfBottles}
</label>
</div>



                )}
              </ul>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Mymainitems;
